import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Profile.css';

function Profile() {
  return (
    <div className="profile">
      <Header />
      <h1>Profile</h1>
      <p>Manage your account details here.</p>
      <Footer />
    </div>
  );
}

export default Profile;
